import React, { Component } from 'react';


class Product extends Component {
  state ={
    products: [],
  }
  componentDidMount(){
    if(this.props.products)
    this.setState({products:this.props.products});
  }
  render() {
    const mapped_products = this.state.products.map((a) =>{
      return (
        <div class="ui card">
        <div class="image dimmable">
          <div class="ui blurring inverted dimmer transition hidden">
            <div class="content">
              <div class="center">
                <div class="ui teal button">Add Friend</div>
              </div>
            </div>
          </div>

        </div>
        <div class="content">
          <div class="header">Title</div>
          <div class="meta">
            <a class="group">Meta</a>
          </div>
          <div class="description">One or two sentence description that may go to several lines</div>
        </div>
        <div class="extra content">
          <a class="right floated created">Arbitrary</a>
          <a class="friends">
            Arbitrary</a>
        </div>
      </div>
      )
    });
    return (
      <div>
          <main >
              {mapped_products}
          </main>
      </div>
    );
  }
}

export default Product;
